import React from 'react'
import {HeroBg,ImageBg,HeroContainer} from './HeroElements';
import video from '../../videos/video.mp4';

const HeroSection = () => {
    return (
        <HeroContainer>
            <HeroBg>
                <ImageBg autoplay loop muted type='video/mp4' src={video}/>
            </HeroBg>
        </HeroContainer>
    )
}

export default HeroSection;
